import { error } from '@sveltejs/kit'
import type { RequestHandler } from './$types'
import { findUserProduct, generateSVGResponse } from '$lib/_api/svgUtils'

export const GET: RequestHandler = async ({ cookies, params }) => {
	const id = params.id
	const shirt = await findUserProduct(cookies, id, 'custom-shirt')

	if (!shirt) {
		throw error(404, 'not found')
	}

	const colorMap = {
		'bg-[#202020]': '#202020',
		'bg-[#ffffff]': '#ffffff',
		'bg-dark-green': '#254441',
		'bg-neon': '#43AA8B',
		'bg-primary': '#DB504A',
		'bg-salmon': '#FF6F59'
	}

	return generateSVGResponse(
		shirt,
		`
	<rect x="5" y="3" width="${parseFloat(shirt.width) - 10}" height="${
			parseFloat(shirt.height) - 6
		}" fill="${colorMap[(shirt.color as keyof typeof colorMap) ?? 'bg-dark-green']}" />
	<image href="data:image/png;base64," x="0" y="0" width="${
		shirt.width
	}" height="${shirt.height}" />
    `,
		false
	)
}
